import React from "react";
import image from "../../image/dow.jpg";
import Preloader from "../../common/Prealoader/Preloader";

const ProfileInfo = (props) => {
  if (!props.profile) {
    return <Preloader />;
  }

  return (
    <div>
      <div className="image">
        <img src={image} alt="" />
      </div>

      <div>ava + description</div>
    </div>
  );
};

export default ProfileInfo;
